import React from 'react';

const CustomSearch = () => {
  return (
    <div className="custom-search">
      <div>
        <h1>Custom Search</h1>
        <div className="select-field">
          Categories
          <select>
            <option>Hats</option>
            <option>Jacket</option>
            <option>Sneakers</option>
          </select>
        </div>
      </div>
    </div>
  );
};

export default CustomSearch;
